package no.uib.info233.tree;import java.util.Iterator;/** * An interface of iterators for the ADT tree. *  * @author Frank M. Carrano * @author Timothy M. Henry * @author Atle Geitung * @version 4.0.uib */public interface TreeIterator<T> {        /**     * Returns a preorder iterator for the tree.     *      * @return preorder iterator     */    Iterator<T> preorderIterator();    /**     * Returns a postorder iterator for the tree.     *      * @return postorder iterator     */    Iterator<T> postorderIterator();    /**     * Returns an inorder iterator for the tree.     *      * @return inorder iterator     */    Iterator<T> inorderIterator();    /**     * Returns a level order iterator for the tree.     *      * @return level order iterator     */    Iterator<T> levelorderIterator();}